import Vue from 'vue';
import App from './App.vue';
import router from './router';
import store from './store';
import './registerServiceWorker'; // FontAwesome

import { library } from '@fortawesome/fontawesome-svg-core';
import { faPlus, faSyncAlt, faSignInAlt, faPowerOff, faBars, faAngleDown, faAngleRight, faAngleLeft, faArrowRight, faBell, faArrowLeft, faHome, faBook, faShoppingCart, faTimes, faCalendarAlt, faChartPie, faSignOutAlt } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/vue-fontawesome';
library.add(faPlus, faSyncAlt, faSignInAlt, faPowerOff, faBars, faAngleDown, faAngleRight, faAngleLeft, faArrowRight, faBell, faArrowLeft, faHome, faBook, faShoppingCart, faTimes, faCalendarAlt, faChartPie, faSignOutAlt);
Vue.component('fa', FontAwesomeIcon); // ClazyLoad

import VueClazyLoad from 'vue-clazy-load';
Vue.use(VueClazyLoad); // ApexCharts

import VueApexCharts from 'vue-apexcharts';
Vue.use(VueApexCharts);
Vue.component('apexchart', VueApexCharts);
Vue.config.productionTip = false;
new Vue({
  router,
  store,
  render: h => h(App)
}).$mount('#app');
